ue nos manifesto que se acercaria a una sede policial a interponerbla denuncia, ya que ademas que no sabia quien hurto sus pertenencias, ya habia manipulado su cartera, por lo gual esta se acercaria a una sede a interponer la denuncia por que no tenia tiempo, se dirigia al hospital zacamil al area de cirugia, esta nos manifesto que es enfermera que trabaja para los hopitales publicos de san salvador, por lp cual procedimos a retirarnos','3a Calle Poniente Shafick Handal 3, San Salvador, El Salvador',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'-89.2280281','13.7041512',5,42,NULL,6,0,1,16708,0,1,0,1,701,'2023-05-03 17:41:00','2023-11-15 14:20:47',36,2,NULL,NULL);
