mos a retirarnos del lugar ya que el vehiculo fue remolcado del lugar por grua que trajeron familiares','Boulevard Constitución y, C. San Antonio Abad, San Salvador, El Salvador',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'-89.2229989','13.7182608',5,2,NULL,6,0,1,16708,0,1,0,1,701,'2023-05-07 08:13:53','2023-11-15 14:20:52',36,2,NULL,NULL);
